import { useState } from "react";
import { Link } from "react-router-dom";
import "../../../styles/style.css";

export const Chest = () => {
  //Define um estado para armazenar os valores dos campos do formulário
  const [formValues, setFormValues] = useState({
    chiado_no_peito: false,
    falta_de_ar: false,
    tosse_persistente: false,
    tosseseca: false,
  });

  // Função que atualiza o estado quando um campo é modificado
  const handleInputChange = (event) => {
    const { name, checked } = event.target;
    setFormValues({ ...formValues, [name]: checked });
  };

  return (
    <div>
      <h1>Sintomas no Peito</h1>
      <form>
        <label>
          <input
            type="checkbox"
            name="chiado_no_peito"
            checked={formValues.dor_de_cabeca}
            onChange={handleInputChange}
          />
          Dor de cabeça
        </label>
        <label>
          <input
            type="checkbox"
            name="falta_de_ar"
            checked={formValues.nausea}
            onChange={handleInputChange}
          />
          Náusea
        </label>
        <label>
          <input
            type="checkbox"
            name="tosse_persistente"
            checked={formValues.sensibilidade_a_luz}
            onChange={handleInputChange}
          />
          Sensibilidade a Luz
        </label>
        <label>
          <input
            type="checkbox"
            name="tontura"
            checked={formValues.tontura}
            onChange={handleInputChange}
          />
          Tontura
        </label>
        <label>
          <input
            type="checkbox"
            name="visao_turva"
            checked={formValues.visao_turva}
            onChange={handleInputChange}
          />
          Visão turva
        </label>
        <Link to="/body">
          <button type="submit">Próximo</button>
        </Link>
      </form>
    </div>
  );
};
